import React, { useState } from "react";
import { Container, Typography, Card, CardContent, Grid, LinearProgress, Modal, Backdrop, Fade } from "@mui/material";

// Frontend Skills
const frontendSkills = [
    { title: "JavaScript", level: 90 },
    { title: "React.js", level: 85 },
    { title: "HTML5", level: 90 },
    { title: "CSS3", level: 85 },
    { title: "HTML5", level: 95 },
    { title: "CSS", level: 100 },
    { title: "Figma", level: 90 },
];

// Backend Skills
const backendSkills = [
    { title: "Java", level: 90 },
    { title: "C", level: 75 },
    { title: "Python", level: 65 },
    { title: "TypeScript", level: 70 },
    { title: "R", level: 80 },
    { title: "MySQL", level: 85 },
    { title: "React-Native", level: 85 }, // Note: React-Native can be used for mobile (frontend) or backend
    { title: "FastAPI", level: 60 },
    { title: "JSON", level: 90 },
    { title: "Node.js", level: 90 },
];

// Common Skills (Tools and Practices)
const commonSkills = [
    { title: "Postman", level: 80 },
    { title: "Git", level: 95 },
    { title: "Linux", level: 70 },
];
const calculateAverageLevel = (skills) => {
    const totalLevels = skills.reduce((sum, skill) => sum + skill.level, 0);
    const averageLevel = totalLevels / skills.length;
    return Math.round(averageLevel * 100) / 100; // Round to two decimal places
};

// Render average skill card
const renderAverageSkillCard = (category, averageLevel) => (
    <Grid item xs={12} sm={6} md={6} key={category}>
        <Card elevation={3}>
            <CardContent>
                <Typography variant="h6" color="textSecondary" gutterBottom>
                    {category}
                </Typography>
                <LinearProgress variant="determinate" value={averageLevel} />
                <Typography variant="body2" color="textSecondary">
                    Average Level: {averageLevel}%
                </Typography>
            </CardContent>
        </Card>
    </Grid>
);

// SkillDetailModal Component
const SkillDetailModal = ({ open, onClose, skillData }) => {
    return (
        <Modal
            open={open}
            onClose={onClose}
            closeAfterTransition
            BackdropComponent={Backdrop}
            BackdropProps={{
                timeout: 500,
            }}
        >
            <Fade in={open}>
                <div>
                    <Typography variant="h6" color="textSecondary" gutterBottom>
                        {skillData.title}
                    </Typography>
                    <Typography variant="body2" color="textSecondary">
                        Level: {skillData.level}%
                    </Typography>
                    {/* Add more details about the skill as needed */}
                </div>
            </Fade>
        </Modal>
    );
};

// Skill Component
const Skill = () => {
    const [modalOpen, setModalOpen] = useState(false);
    const [selectedSkill, setSelectedSkill] = useState(null);

    const handleCardClick = (skillData) => {
        setSelectedSkill(skillData);
        setModalOpen(true);
    };

    const handleModalClose = () => {
        setModalOpen(false);
    };

    return (
        <Container id="intro" sx={{ display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center", height: "100%" }}>
            <Typography variant="h2" fontWeight={"bold"} align="center" mb={10}>
                Skills
            </Typography>
            <Grid container spacing={3}>
                {/* Frontend Skills */}
                <Grid item xs={12} sm={6} md={6} key="Frontend Skills">
                    <Card elevation={3} onClick={() => handleCardClick(frontendSkills)}>
                        <CardContent>
                            <Typography variant="h6" color="textSecondary" gutterBottom>
                                Frontend Skills
                            </Typography>
                            <LinearProgress variant="determinate" value={calculateAverageLevel(frontendSkills)} />
                            <Typography variant="body2" color="textSecondary">
                                Average Level: {calculateAverageLevel(frontendSkills)}%
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>

                {/* Backend Skills */}
                {/* (Backend Skills 카드에 대해서도 위와 같이 수정) */}

                {/* Common Skills */}
                {/* (Common Skills 카드에 대해서도 위와 같이 수정) */}
            </Grid>

            <Typography variant="body1" align="center" color="textSecondary" mt={5} paragraph>
                Click cards to see detail about skills
            </Typography>

            {/* Modal for Skill Details */}
            {selectedSkill && (
                <SkillDetailModal open={modalOpen} onClose={handleModalClose} skillData={selectedSkill} />
            )}
        </Container>
    );
};


export default Skill;
